Technology Documentary hosted by Brooks T Moore, published by Discovery Channel in 2012 - English narration


Information
------------------------------

How It's Made: Auto 
In the edition of How It's Made Auto DVD, gas up for a hot rod of a documentary on all things automotive. Get an inside look at how auto parts start off as raw materials and end up as essential pieces of the machine it finally becomes. An exciting How It's Made DVD will thrill anyone who loves vehicles of every purpose. And it's a definite must-have for any gear head too!, for this super-charged collection of How It Made, exploring all things automotive, taking you on a ride down the assembly lines of the motor world most fascinating creations, including luxury cars, mini motorcycles, amphibious vehicles, hearses and fire trucks. From bumper to bumper and beyond, discover the mechanics behind the mechanics in this custom collection of How It Made.
INCLUDES 53 AUTO SEGMENTS!


